const SERVER_PORT = '3001';
const SERVER_URI = 'https://localhost:';

/**
 * @param {Array<number>}
 */
export default function fetchMove(board) {
  fetch(`${SERVER_URI}${SERVER_PORT}/id:123`, {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    credentials: 'include',
    body: JSON.stringify(board)
  })
}
